(4750, 1484, 590, 5, 'Concession', '', '2007-10-08 00:00:00', 0000, 30, 0, 7, '', ' 意義是流動的線　全握在你的手裡面\n 多希望我看得見　你心理神秘的空間\n 但夢想依然很遙遠　未來還是畫不圓\n \n Am I losing you? Am I losing you?\n \n 走向沒人的秋千　把心情放在上面\n 努力推的高又遠　希望幸福會實現\n 但未來依然很遙遠　未來還是畫不圓\n \n Am I losing you? Am I losing you?\n \n And why don''t you stop\n Summer tears can''t even let you warm\n Can''t let you high\n All the regret shining in the eyes\n That''s everybody con easily find\n So I keep counting down 12345 to 6\n I hope that you can hear\n ''cause every sound,every counting beat\n just show you all my misery ', 378, '', '', '', '', '', '', 1, 1, 0, '2008-05-22 22:27:48', '2015-03-12 13:32:35', '0000-00-00 00:00:00'),
