(4762, 1484, 590, 17, 'You''ll See', '', '2007-10-08 00:00:00', 0000, 30, 0, 7, '', '我看著站在遠方的你依然如此美好如往昔\nBut you know 有些話就是不能明說\n\n我看著站在眼前的你依然如此美好如往昔\nBut you know 有些話就是不能明說\n多年時光 都溫柔經過\n那麼多人 來了又走\n但也許我們只能遠望不相逢\n\n一個人漸成熟 就會笑著淚流\n總有些遺憾要學會放開\n活到這把年紀也該明白\n\nBut I say you''ll see, I''d make you see\nEvery detail of this damning life\nI say you''ll see, I''d make you see\nYou''ll see\n\n在這個匆忙的世界裡 失去什麼 受不受傷 都一樣\nBut you know 只有你是如此絕對不同\n不奢求哪天 我不要人懂\n總在心底偷藏起這小美夢\n這樣的溫熱就已經足夠\n\n一個人漸成熟 就會笑著淚流\n總有些麻煩是人躲不開\n活到這把年紀也該明白\n\nBut I say you''ll see, I''d make you see\nEvery detail of this damning life\nI say you''ll see, I''d make you see\nYou''ll see\n\n我不斷聽你說 說著他的美好 說著你們的夢\n這一切真的很重要 請你相信我 我真的什麼都不要\n到底怎樣才能算是愛 請不要靠得太近\n我背後柔軟的傷口 不想讓人觸摸\n但在你轉身瞬間 淚在心底成了河流', 399, '', '', '', '', '', '', 1, 1, 0, '2008-05-22 22:33:40', '2015-03-12 13:32:35', '0000-00-00 00:00:00'),
