(4766, 1480, 591, 3, '我的名字叫做吉米漢醉克斯', '', '2003-09-01 00:00:00', 0000, 20, 0, 7, '', '砰砰砰砰　砰砰砰砰　砰砰砰砰　砰砰砰砰\n我的名字叫做吉米漢醉克斯\n\n砰砰砰砰　砰砰砰砰　砰砰砰砰　砰砰砰砰\n香煙刁在嘴巴　不可以熄掉\n\n砰砰砰砰　砰砰砰砰　砰砰砰砰　砰砰砰砰\nS O L O　　一直彈下去\n砰砰砰砰　砰砰砰砰　砰砰砰砰　砰砰砰砰\nB L U E　　迷幻會頭暈\n不要.....停\nONO...不要停\n我的名字叫做吉米漢醉克斯', 139, '', '', '', '', '', '', 1, 1, 0, '2008-05-22 22:43:40', '2015-03-12 13:32:35', '0000-00-00 00:00:00'),
