(4777, 1480, 592, 1, '魯道夫的復仇', '', '2003-12-01 00:00:00', 0000, 20, 0, 7, '', 'Silent night , Holly night , 該死的 Crazy night\n小男孩 小女孩 眼神充滿期待\n不作怪 不耍賴 今天每一個都特別乖\n雪白白 飄下來 神聖的一刻就要來\n煙囪蓋 要打開 襪子千萬不可以掛歪\n真可愛 真可愛 胖子從煙囪掉下來\n她Hohoho笑起來 皮鞭用力抽下來\n大家乖乖站一排 把禮物放在布袋\n皮鞭越抽越豪邁 屁股的花就要開\n眼淚差點掉下來 告訴自己 I can''t cry\n等到小朋友散開 把他拖去冰山埋\n估的掰 估的奈 沒有用的小孩 動作快 動作快 時間不會等待\n冷風他 吹過來 鼻子紅腫的特別厲害\n天使降 落下來 笑到眼淚都留出來\n眼皮快 塌下來 睡著了就有皮鞭招待\n魯道夫 的悲哀 沒有人可以來了改\n', 185, '', '', '', '', '', '', 1, 1, 0, '2008-05-22 22:57:43', '2015-03-12 13:32:35', '0000-00-00 00:00:00'),
