(4779, 1484, 593, 1, '雛菊之歌', '', '2007-03-30 00:00:00', 0000, 20, 0, 7, '', '是誰將玫瑰花放在我枕邊\n那芬芳整夜裡蕩漾\n輕輕地甜進了心房\n\n又是誰將眼淚寄予有情人\n動不動就濕潤了眼框\n連快樂都不能負荷\n\n是你 帶我重回到美麗少女時光\n分離 這一刻都讓我悲傷到不能呼吸\n我每個毛孔 都在說愛你\n只一絲甜蜜 就夠我愛你\n就算踐踏我 也要說愛我\n像說話娃娃 只重複我愛你', 175, '', '', '', '', '', '', 1, 1, 0, '2008-05-22 23:08:07', '2015-03-12 13:32:36', '0000-00-00 00:00:00'),
