(4784, 1468, 595, 1, 'God Father', 'Maybe的音樂有著兩位吉他手以破壞性的吉他刷扣鋪陳，而貝斯手低沉的衝擊音量震撼著每一張耳朵,吉他手分別瘋狂獨奏 ,更帶來整首樂曲的高潮 ,KB手擅長以旋律鮮明的鍵盤音色細膩銜接著一個轉折,鼓手穩重的雙踏卻又帶著靈魂般的前衛節奏為曲子的創作注入新的生命 ,主唱時而高亢時而嘶吼的唱腔貫穿整首樂曲 ,將各個角色串聯出一段屬於Maybe的金屬。', '2008-05-22 00:00:00', 0000, 35, 0, 9, 'Father fix them all ,Waiting for his call \r\nWe these messed toys ,May beg the cross \r\n\r\nHave you ever seen the Asgard or the hell in your eyes \r\nHave you ever hear the Gospel or the curse on the court\r\n\r\nCan you get rid of the hell ,My son keep your step with him\r\nOh ,don''t you know the name of our mighty God --- The evil Lucifer\r\n\r\nHave you ever seen the Asgard or the hell in your eyes \r\nHave you ever hear the Gospel or the curse on the court ...', '', 414, '', 'MayBe', 'MayBe', 'MayBe', '大業千秋', '', 0, 1, 0, '2008-05-23 01:21:54', '2015-03-12 13:32:36', '0000-00-00 00:00:00'),
