(4931, 1468, 595, 2, 'Crash Before 27', '謹以此紀念在搖滾路上指引我們的大師們;紀念偉大的靈魂導師Randy Rhoads.............\r\n', '2008-05-22 00:00:00', 0000, 25, 0, 9, 'May we fall\r\nHearing Satan''s call\r\nAs we die\r\nTime still goes by\r\n                                                                               \r\nCan you see\r\nEagle still fly free\r\nCan you hear\r\nThe sound of the dream\r\n                                                                               \r\nchorus:                                                                               \r\nHave you seen the tears when devil''s angels cry\r\nThat shines the way to hell\r\nor to paradise\r\n                                                                               \r\nSave our souls\r\nNot by the cross\r\nBatter use the Randy Rhoads\r\nHeal our pain\r\n                                                                                \r\nRide the lightening\r\nAre you ready to rock\r\ntill we all die in the crash\r\n                                                                                \r\nHe''s not tall\r\nOzzy say so\r\n                                                                                \r\nBut He''s the lord\r\ncan''t take no more\r\n                                                                                \r\nI open the door\r\nRandy say hello\r\nlet me follow\r\nthe step of you\r\n                                                                                \r\nrepeat to chorus\r\n', '', 420, '', 'Mary', 'Mary', 'Mary', '大業千秋', '', 0, 1, 0, '2008-05-24 19:08:06', '2015-03-12 13:32:41', '0000-00-00 00:00:00'),
(4932, 1468, 595, 3, 'Lycan', '狼人的故事.........', '2008-05-22 00:00:00', 0000, 30, 0, 9, '主歌\r\nBehind the face\r\nuncontrolled fate\r\nAnother race\r\nSomething is gonna change\r\n\r\nThe teeth get longer\r\nThe eyes get darker\r\nHuman betrayer\r\nWe call them the lycans\r\n\r\n副歌\r\nIn the blood of the dark\r\nA feeling goes so far\r\nIn the light of the night\r\nAnd a sword digs the hear\r\n\r\nWhen the time we crying\r\nAll we taste is bleeding\r\nThey thought we are freak\r\nCross is not healing\r\n\r\n主歌\r\nWith the scenes of the evil\r\nAs I saw before\r\nThe girl was bleeding\r\nWhat Emma''s crying for\r\n\r\nUnfair no longer\r\nThe death without care\r\nThe girl''s still bleeding\r\nI sold out my soul\r\n\r\n副歌\r\nIn the air of the dark \r\nAnd a voice goes far\r\nIt tells the truth\r\nDisappear with shot\r\n\r\nIn my mind I can''t know\r\nhow cold she will feel\r\nThe vampire still said\r\nAll human go hell\r\n\r\n', '', 253, '', 'Mary', 'Mary', 'Mary', '大業千秋', '', 0, 1, 0, '2008-05-24 19:12:07', '2015-03-12 13:32:41', '0000-00-00 00:00:00'),
(4933, 1468, 595, 4, '月花樓', '一個平凡男子愛上一位花樓女子，兩人處於不同世界，最後才明白這段戀情的曲折.....', '2008-05-22 00:00:00', 0000, 30, 0, 9, '看著以停止的落葉 \r\n只想著花朵已經枯萎\r\n妳的眼睛泛著暗月\r\n卻看不見放開的眼淚\r\n\r\n想像回到最初的淚\r\n付出的愛情像是飛燕\r\n只想換取一種感覺\r\n最後卻留給我月花美\r\n\r\n等待愛情的幻滅\r\n我自己面對月花樓中月\r\n\r\n冷漠堅硬的項鍊\r\n它不在冷卻\r\n散發出他的美艷\r\n她不在身邊 \r\n\r\n回不來當初的美麗\r\n就算在堅持你早離去\r\n回不來的是我的心\r\n你再愛我也無意義\r\n\r\n等待愛情的幻滅\r\n我要自己面對一切一夜\r\n不可多得的世界\r\n我知道人去樓空心以滅\r\n\r\n冷漠堅硬的項鍊\r\n它不在冷卻\r\n散發出他的美艷\r\n我終於醒了\r\n', '', 281, '', 'Beer', 'Beer', 'Beer', '大業千秋', '', 0, 1, 0, '2008-05-24 19:16:36', '2015-03-12 13:32:41', '0000-00-00 00:00:00'),
