(4937, 320, 0, 1, '下北澤的保密防諜', '', '2008-05-01 00:00:00', 0000, 0, 1, 7, '私鐵 人群 商店街的叫賣\r\n廣島燒的快手多桑\r\n牆上的喇叭唱著英國腔\r\nOh Beatles, wanna hold your hand\r\n\r\n街燈在打光 少年彈唱告白\r\n手指框架聚焦 沉醉在你的浪漫\r\n\r\nWe listen, We feel, We can\r\nTouched by\r\nyour word, your sound, your move\r\nYou move us to the sky\r\nAnd rise, and fall, thank you\r\n\r\n步道 情侶 Oshara的櫥窗\r\n章魚燒的Kirei卡桑\r\n牆上海報的Strato在燃燒\r\nOh Jimi , FIRE !!!\r\n\r\n街燈在打光 少女街頭劇場\r\n手指框架聚焦 你的羞澀對白\r\n\r\nWe listen, We feel, We can\r\nTouched by\r\nyour word, your sound, your move\r\nYou move us to the sky,\r\nAnd rise, and fall, thank you\r\n', '', 265, '', '早尊', '早尊', 'Zag Lope', 'Zag Lope', '', 0, 0, 1, '2008-05-26 11:27:50', '2013-10-07 17:12:24', '0000-00-00 00:00:00'),
